function Contact() {
    return (
        <div id="contact" className="row px-4 py-12 mx-auto sm:max-w-2xl md:max-w-full lg:max-w-screen-2xl md:px-28 lg:px-8 lg:py-20 relative z-10 bg-[rgba(0,0,0,0.64)] backdrop-blur border-black">
            <div className="contact-left">
                <h1 className="sub-title">Contact Me</h1>
                <p><i className="fab fa-paper-plane"></i>meetsuthar299@gmail.com</p>
                <a href="images/my-cv.pdf" download className="btn btn2">Download Resume</a>
            </div>
            <div className="contact-right">
                <form action="">
                    <input type="text" name="name" placeholder="Your Name" required />
                    <input type="email" name="email" placeholder="Your Email" required />
                    <textarea name="message" rows={6} placeholder="Your Message"></textarea>
                    <button type="submit" className="">Submit</button>
                </form>
            </div>
        </div>
    );
}

export default Contact;
